import React, { Component } from 'react';
import TopBar from './TopBar/TopBar';
import Slot from './Slot';
import { ThemeProvider } from 'react-bootstrap';

export default class App extends Component {
    render() {
        return (
            <div>
                <ThemeProvider>
                    <header>
                        <TopBar />
                    </header>
                    <body>
                        <Slot />
                    </body>
                </ThemeProvider>

            </div>

        )
    }
}
